import React from 'react';

const NavigationBar = () => {
  const navStyle = {
    backgroundColor: '#333', // Background color of the navigation bar
    color: '#fff', // Text color
    padding: '10px', // Padding for the navigation bar
    textAlign: 'center', // Center align the items
  };

  return (
    <div style={navStyle}>
      <h2>My Portfolio</h2>
    </div>
  );
};

export default NavigationBar;
